import './App.css';
import Grid from '@material-ui/core/Grid';
import Container from '@material-ui/core/Container';
import Box from '@material-ui/core/Box';
import processImg from '../src/processImg.svg'

function Process() {
  return (
    <Container maxWidth="xl" 
    style={{ 
      background: '#F2E7D6', 
      position: "relative"}}>
     <Grid container spacing = {4} alignContent="flex-end"  alignItems="flex-end" justifyContent="center" style = {{position: "relative"}} > 
      <Grid item xs={8}>
           <h1 style = {{fontSize: 48, fontFamily: "yeseva one", position: "relative", paddingLeft: "10%"}}>The Process</h1>
        </Grid>
        <Grid item xs={4}>
            <img className="my-svg" src = {processImg} height = "150px" style = {{position: "relative"}}/>
        </Grid> 
    </Grid>
    <hr  style={{ width: '130%', borderColor: "black", paddingLeft: "10%"}}/>
    <Grid item xs={8}>
        <Box p={0}>
          <p style = {{ paddingLeft: "10%", lineHeight: "30px", width: "205%", fontFamily:"josefin sans", fontSize: 24, position: "relative"}}>A customer-oriented consulting process. Whatever the challenge, time frame, and budget, I can help you on your journey to success.
            A process with the ultimate goal of making you happy. </p>
          </Box>
          </Grid>
    </Container>
  )
}

export default Process;
